**Field Characteristics:**

Russuloid. Large. Variable tan with subtle notes of green and maroon. Growing in open mixed oak/hickory woodland edge near Ash, Shagbark Hickory, Bur Oak, and American Hop Hornbeam. Pileipellis tearing easily 1/3 to the center from the margin.

Ammonia: Pileipellis: flashing olive then turning lightly pale. Stipe: negative.
KOH: Pileipellis: bright orange. Stipe: negative.

Taste: mild then slightly acrid." > ./species/russula-9546.md

