**Field Characteristics:**

#144

Growing on large rotting hardwood log in the bottom of large, moist woodland draw. 

Flesh tough and spongy, saturated with water hirsute (hairy). Concentric zoning and outer margin lighter color. Cap yellow-orange on top and white to orange on hymenium. Pores irregular and almost maze-like.

KOH: Instantly brown on cap and hymenium. 
Ammonia: Quickly darkening surfaces then returning to normal color. 
Taste: Faintly bitter. 
Smell: Strong, reminiscent of Ganoderma applanatum.
Sporeprint: White" > ./species/trametopsis-cervina-9879.md

