#230


-Growing gregariously in open mixed oak/hickory woodland.
-Nearby Trees: Ash, Chinkapin Oak, American Hophornbeam, Bur Oak, and Shagbark Hickory.

-Cap sturdy, green, cracking in patches, white to light tan beneath, with an inrolled margin. Pileipellis easily peeling 2/3 to the center from margin.
-Stipe sturdy and unchanging in color.
-Lamellae cream to pinkish, forking occasionally near apex of stipe.

-Smell: not distinctive.
-Taste: not distinctive.
-KOH: slowly pale orange on pileipellis.
-Ammonia slightly darkening pileipellis." > ./species/virescentinae-3210.md

