**Field Characteristics:**

#269

-Growing solitarily in open mixed oak/hickory woodland.
-Nearby Trees: Northern Red Oak, Easter Red Cedar, American Hophornbeam, Shagbark Hickory, Bitternut Hickory, and Honey Locust.

-Cap deeply wrinkled, especially around margin, and unchanging where handled or scratched.
-Hymenium bright yellow circular pores slightly sunken at apex of stipe, unchanging where damaged.
-Stipe pale yellow at apex, turning slightly brownish and darkening where handled near base (slightly rooted in soil). Stipe also adorned with tiny inconspicuous scabers. 
-Basal mycelium white.
-Flesh unchanging where exposed.

-Smell: not distinctive.
-Taste: not distinctive.
KOH: dark orange on pileipellis, pale orange on tube layer and stipe.
Ammonia: darkening pileipellis, negative on trama/tube layer and stipe.

