**Field Characteristics:**

293

Or close taxon. 

Growing gregariously in needles and duff under Eastern Red Cedar and Chinquapin oak on the edge of a mixed oak/ hickory woodland.
Trees: eastern red cedar, chinquapin oak, red oak, and Elm

- Cap: funnel shaped with deep central depression (catching rainwater); concentric zonation alternating between different shades of orange. Old specimens brittle. Tacky. Inrolled margin on young specimens, fanning out on older ones.
- Gills: decurrent, exuding white to cream latex. Latex scarce. Cutting tissue doesnt result in latex. Existing latex on gills in seemingly random locations.
- Stipe: short (3cm); firm; tan colored.
- Smell: fruity; apricot-like
- Taste: EXTREMELY ACRID (spicy)
- KOH: pileipellis: faint yellow; gills: indistinct; stipe: darkens surface.
- Ammonia: pileipellis: indistinct to darkening; gills: indistinct; stipe: darkens

L. psamicola is a close taxon, however, it is described as having a hairy margin in young specimens (Kay, et al, 2022) and this one has a smooth to slightly flocose margin at best in young specimens." > ./species/lactarius-psammicola-2912.md

